commit_message:
Improve Community docs to better address @freakboy3742's question about where to discuss/narrow down Cookiecutter problems.

From Twitter: "Haven't got a well isolated issue suitable for a bug report yet; whats the best forum for discussing/narrowing down a problem?"

@freakboy3742 if I can address this better in any other way, let me know. To be honest I'm still learning the ropes: this is my first open source project that has gotten far enough to even need a forum.
